import React, { useEffect, useState } from "react";
import axios from "axios";

const UserList = () => {
  const [users, setUsers] = useState([]);

  useEffect(() => {
    const load = async () => {
      try {
        // Gọi backend qua proxy CRA -> http://localhost:5000/users
        const res = await axios.get("/users");
        setUsers(res.data);
      } catch (err) {
        console.error(err);
      }
    };
    load();
  }, []);

  return (
    <div>
      <h2>User List</h2>
      <ul>
        {users.map((u) => (
          <li key={u._id || u.id}>{u.name}</li>
        ))}
      </ul>
    </div>
  );
};

export default UserList;
